import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './AdminDashboard.css';

const AdminDashboard = () => {
    const navigate = useNavigate();
    const [activeTab, setActiveTab] = useState('dashboard');
    const [sidebarOpen, setSidebarOpen] = useState(true);

    // Sample data - replace with real data from your API
    const [stats, setStats] = useState({
        users: 1243,
        orders: 89,
        revenue: '$12,845',
        growth: '+12%'
    });

    const recentOrders = [
        { id: 1, customer: 'John Doe', amount: '$125', status: 'Completed' },
        { id: 2, customer: 'Jane Smith', amount: '$89', status: 'Processing' },
        { id: 3, customer: 'Robert Johnson', amount: '$245', status: 'Shipped' },
        { id: 4, customer: 'Emily Davis', amount: '$67', status: 'Completed' },
        { id: 5, customer: 'Michael Brown', amount: '$199', status: 'Pending' }
    ];

    const handleLogout = () => {
        // Add your logout logic here
        navigate('/admin-login');
    };

    return (
        <div className={`admin-dashboard ${sidebarOpen ? 'sidebar-open' : 'sidebar-collapsed'}`}>
            {/* Sidebar */}
            <div className="admin-sidebar">
                <div className="sidebar-header">
                    <h2>Admin Panel</h2>
                    <button 
                        className="sidebar-toggle" 
                        onClick={() => setSidebarOpen(!sidebarOpen)}
                    >
                        {sidebarOpen ? '◀' : '▶'}
                    </button>
                </div>
                
                <nav className="sidebar-nav">
                    <button 
                        className={`nav-item ${activeTab === 'dashboard' ? 'active' : ''}`}
                        onClick={() => setActiveTab('dashboard')}
                    >
                        <span className="nav-icon">📊</span>
                        {sidebarOpen && <span>Dashboard</span>}
                    </button>
                    <button 
                        className={`nav-item ${activeTab === 'users' ? 'active' : ''}`}
                        onClick={() => setActiveTab('users')}
                    >
                        <span className="nav-icon">👥</span>
                        {sidebarOpen && <span>Users</span>}
                    </button>
                    <button 
                        className={`nav-item ${activeTab === 'orders' ? 'active' : ''}`}
                        onClick={() => setActiveTab('orders')}
                    >
                        <span className="nav-icon">📦</span>
                        {sidebarOpen && <span>Orders</span>}
                    </button>
                    <button 
                        className={`nav-item ${activeTab === 'products' ? 'active' : ''}`}
                        onClick={() => setActiveTab('products')}
                    >
                        <span className="nav-icon">🛍️</span>
                        {sidebarOpen && <span>Products</span>}
                    </button>
                    <button 
                        className={`nav-item ${activeTab === 'settings' ? 'active' : ''}`}
                        onClick={() => setActiveTab('settings')}
                    >
                        <span className="nav-icon">⚙️</span>
                        {sidebarOpen && <span>Settings</span>}
                    </button>
                </nav>
                
                <button className="logout-btn" onClick={handleLogout}>
                    <span className="nav-icon">🚪</span>
                    {sidebarOpen && <span>Logout</span>}
                </button>
            </div>

            {/* Main Content */}
            <div className="admin-content">
                <header className="admin-header">
                    <h1>Dashboard Overview</h1>
                    <div className="header-actions">
                        <button className="notification-btn">🔔</button>
                        <div className="admin-profile">
                            <span className="profile-avatar">A</span>
                            {sidebarOpen && <span className="profile-name">Admin</span>}
                        </div>
                    </div>
                </header>

                <main className="dashboard-content">
                    {/* Stats Cards */}
                    <div className="stats-grid">
                        <div className="stat-card">
                            <h3>Total Users</h3>
                            <p className="stat-value">{stats.users}</p>
                            <p className="stat-trend positive">↑ 12% from last month</p>
                        </div>
                        <div className="stat-card">
                            <h3>Today's Orders</h3>
                            <p className="stat-value">{stats.orders}</p>
                            <p className="stat-trend positive">↑ 5% from yesterday</p>
                        </div>
                        <div className="stat-card">
                            <h3>Revenue</h3>
                            <p className="stat-value">{stats.revenue}</p>
                            <p className="stat-trend positive">↑ 8% from last week</p>
                        </div>
                        <div className="stat-card">
                            <h3>Growth Rate</h3>
                            <p className="stat-value">{stats.growth}</p>
                            <p className="stat-trend negative">↓ 2% from last quarter</p>
                        </div>
                    </div>

                    {/* Recent Orders Table */}
                    <div className="recent-orders">
                        <h2>Recent Orders</h2>
                        <div className="table-container">
                            <table>
                                <thead>
                                    <tr>
                                        <th>Order ID</th>
                                        <th>Customer</th>
                                        <th>Amount</th>
                                        <th>Status</th>
                                        <th>Action</th>
                                    </tr>
                                </thead>
                                <tbody>
                                    {recentOrders.map(order => (
                                        <tr key={order.id}>
                                            <td>#{order.id}</td>
                                            <td>{order.customer}</td>
                                            <td>{order.amount}</td>
                                            <td>
                                                <span className={`status-badge ${order.status.toLowerCase()}`}>
                                                    {order.status}
                                                </span>
                                            </td>
                                            <td>
                                                <button className="action-btn">View</button>
                                            </td>
                                        </tr>
                                    ))}
                                </tbody>
                            </table>
                        </div>
                    </div>
                </main>
            </div>
        </div>
    );
};

export default AdminDashboard;
